import React, { Component } from 'react';
import Carousel from '@brainhubeu/react-carousel';
import '@brainhubeu/react-carousel/lib/style.css';


export default class MyCarousel extends Component {
  render() {
    return (
        <Carousel
        autoPlay={2000}
        animationSpeed={1000}
        infinite
        arrows>
        <img src= '../Carousel/img/imageOne.png' />
        <img src= "../Carousel/img/imageTwo.JPG" />
        <img src= "../Carousel/img/imageThree.png" />  
        </Carousel>
    );
  }
}
